import React from 'react';

const Card = (props) => {
    return (
        <div className="rounded-lg p-5 m-3 flex-grow-1 d-flex flex-column align-items-center justify-content-center" 
            style={{backgroundColor: props.Background}}>

            <h5 className="text-center">
                {props.Title}
            </h5>

        </div>
    );
}

export default Card;
